import React, {Component} from 'react';
import { Router, Link } from '@reach/router';
import './App.css';
import RouteProject from './Components/route-projects';
import RouteAddProject from './Components/addprojects'; 


class App extends Component {



  render(){
    return (
      <div className="app">


          <div className="header">
            <span>Welcome Peter</span> <i className="fas fa-bars"></i>
            <ul className="menu">
            <Link to="projects">Projects</Link> |{" "}
            <Link to="projects/create">Add a project</Link>
              <li><a href="">Login</a></li>
              <li><a href="">Signup</a></li>
            </ul>
          </div>

          <Router>
            <RouteProject path="projects"/>
            <RouteAddProject path="projects/create"/>
          </Router>


      </div>
    );
  }
}

export default App;
